using namespace std;
 
class PluCodeGenerator {
public:
  int isInValid(int N){
    vector<int> v;
    while (N!=0) {
      v.push_back(N%10);
      N/=10;
    }
    for (int i=0; i+2<v.size(); i++){
      if (v[i] == v[i+1] && v[i] == v[i+2]) return 1;
    }
    return 0;
  }
  int invalidInThousand(int N){
    vector<int> v;
    while (N!=0) {
      v.push_back(N%10);
      N/=10;
    }
    for (int i=0; i+2<v.size(); i++){
      if (v[i] == v[i+1] && v[i] == v[i+2]) return 1000;
    }
    if (v.size() == 0) return 9;
    if (v.size() >= 2 &&  v[0] == v[1]) return 109;
    return 19;
  }
  int countInvalidCodes(int N) {
    int ret = 0;
    int j;
    for (j=0; j<N/1000; j++) {
      ret += invalidInThousand(j);
    }
    for (int i=j*1000; i<N; i++) ret+= isInValid(i);
    return ret;
  }
};
 
 
